import React from "react";

const Form = ({ title = false, form }) => {
  return (
    <section className="flex max-md:flex-col-reverse">
      <div>
        <h2 className="title">{(title = false)}</h2>
      </div>
      <form>
        {form.map((label, type, index) => {
          return (
            <>
              <label htmlFor={label.replace(/\s/g, "")}></label>
              <input id={label.replace(/\s/g, "")} type="text" />
            </>
          );
        })}
      </form>
    </section>
  );
};

export default Form;
